`,A.jsx(r.h2,{children:"Conclusion"}),`
`,A.jsx(r.p,{children:"The builder pattern is extremely helpful. If you're comfortable with the class style builder and like that pattern best, great! However, if you're running into issues with side effects, mutation, or class level state, I hope you'll give the functional builders a try."}),`
